<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    @title()
    <style>
        @import url(https://fonts.googleapis.com/css?family=Lato:300,400,700);

        html, body {
            height: 100%;
        }

        body {
            margin:0;
            font-family:'Lato', sans-serif;
            text-align:center;
            background: #030303;
            color: #999;
        }

        .welcome {
            width: 300px;
